import React from 'react'

export default function Card() {
    return (
        <div>
            <div>
                <div className="card mt-3" style={{ "width": "18rem", "maxHeight": "360px " }}>
                    <img src="https://tse2.mm.bing.net/th?id=OIP.AspiFgzzgPOqN6DsaOLjuAHaFj&pid=Api&P=0&h=180" className="card-img-top" alt="..." />
                    <div className="card-body">
                        <h5 className="card-title">Card title</h5>
                        <p className="card-text">This is important.</p>
                        <div className="container w-100"></div>
                        <select className='m-2 h-100  bg-success rounded'>
                            {
                                Array.from(Array(6), (e, i) => {
                                    return (
                                        <option key={i + 1} value={i + 1}> {i + 1} </option>
                                    )
                                })
                            }
                        </select>
                        <select className='m-2 h-100 bg-success rounded'>
                            <option value="half">Half</option>
                            <option value="half">Full</option>
                        </select>
                        <div className="d-inline h-100 fs-6 ">
                            Total Price
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}
